import React from 'react';
import Heading from './Heading.jsx';
import Para from './Para.jsx';

function IncNum(){
    
    console.log('clicked');
}
function App(){
    return(
        <>
        <Heading/>
        <Para/>
        <h1>0</h1>
        <button onClick={IncNum}>click me</button>
        </>
    )
}
export default App;
